import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' fluid >
        <h1 className='header'>Hi! I'm Ionut Ciornei </h1>
        <h5 className='style'>
           I'm passionate about creating intuitive  and dynamic user <br /> experiences. As someone who has recently transitioned into the world of frontend development,  I'm eager to bring my  unique <br /> perspective and <br /> skills to a forward-thinking company.
        </h5>
        <Image src="/img/me.jpg" alt="me" className='imgStyle'/>
     </Container>      
    )
};

export default Home;
